import React from 'react';
import { MDBNavbar, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBDropdown, MDBDropdownToggle, MDBIcon, MDBDropdownMenu, MDBDropdownItem } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';
import { NavLink } from 'reactstrap';
import 'mdbreact/dist/css/mdb.css';
import 'react-fontawesome/css/font-awesome.min.css';

class NavBar extends React.Component {
  constructor(props) {
      super(props);
      this.state = {
          collapse: false,
      };
      this.onClick = this.onClick.bind(this);
  }

  onClick() {
    this.setState({
        collapse: !this.state.collapse,
      });
  }

  render() {
    const bgPink = {backgroundColor: '#9e9e9e'}
    return(
      <div>
        <Router>
          <header>
            <MDBNavbar style={bgPink} dark expand="md" scrolling fixed="top">
                <MDBNavbarToggler onClick={ this.onClick } />
                <MDBCollapse isOpen = { this.state.collapse } navbar>
                    <MDBNavbarNav left>
                        <MDBNavItem>
                            <NavLink href='/'>Home</NavLink>
                        </MDBNavItem>
                        <MDBNavItem>
                            <NavLink href="/pricing">Portfolio</NavLink>
                        </MDBNavItem>
                        <MDBNavItem>
                            <NavLink href="/pricing">Resume</NavLink>
                        </MDBNavItem>
                        <MDBNavItem>
                            <NavLink href="/create">Contact</NavLink>
                        </MDBNavItem>
                    </MDBNavbarNav>
                </MDBCollapse>
                <MDBNavItem>
                    <MDBDropdown>
                        <MDBDropdownToggle nav caret>
                            <MDBIcon far icon="user" />
                        </MDBDropdownToggle>
                        <MDBDropdownMenu className="dropdown-default">
                            <MDBDropdownItem href="https://github.com/baronvontoby">GitHub</MDBDropdownItem>
                            <MDBDropdownItem href="https://www.linkedin.com/in/lorenzo-dandrea-41b720157/">LinkedIn</MDBDropdownItem>
                        </MDBDropdownMenu>
                    </MDBDropdown>
                </MDBNavItem>
            </MDBNavbar>
          </header>
        </Router>
      </div>
    );
  }
}

export default NavBar;
